import React from 'react';

export default function Section3Component () {
    return (
        <section id='section3'>
            <div className="container">
                <div className="gap">
                    <div className="title hide"><h2>섹션3</h2></div>
                    <div className="content">
                        <a href="!#">
                            <img src="./img/intro/13772c3e-0367-4180-9e01-11ccbf1065a2.jpg" alt="" />
                        </a>
                    </div>
                </div>
            </div>
        </section>
    );
};
